values:
&nbsp;try one job which is 40 hours not including the unpaid half hour lunch break every day as well as, at least for a few weeks, the other job averaging 6-10 hours
im feeling a bit run down already but peg's rght when she says that im used to working 8 hours a week and suddenly im doing 8 hours a day (plus a half hour break for lunch which is unpaid) so effectively 8.5 hours a day. 
scary stuff. this will take getting used to.&nbsp;
the work is fine. it's good and i like it- except that im getting glass cuts ALL OVER MY HANDS and it's (wait for it..drum roll) a week EXACTLY til my piano exam, or was at lunch time anyway. scary stuff. not ready. quite scared.&nbsp;
back to practice. then rest again because it is hurting my shoulder
love yez all

&nbsp;i have an update on the mother of the year awards. mum is in the top 3 for qld. that is at least a bit less overwhelming.&nbsp;
just had an awsome couple of days. mum and her bloody generosity. more on that later if i feel like it.&nbsp;
oh yes thats what i was going to say. i just bought a cordless phone to replace our old ex-telstra-callcenter- type phone. which works perfectly, i just felt like splurging. ah my mum and my fly-buys card. a brilliant team. only cost 7500 points too. bloody cheap phone.&nbsp;
but until that arrives, which could be up to 4 or 5 weeks, we are stuck with the old corded phone.
piano exam in about 8 weeks.
love yez all

cant stay long cos i have a huge headache and have to make the bed, at least to some degree, before i can climb in it cos i washed the sheets today.&nbsp;
so. news.&nbsp;
mum is sending peg and me to seaworld nara resort sunday and monday nights and has booked for peg to swim with the dolphins. guess who's absolutely ecstatic.&nbsp;
then cant forget im seeing phantom at the end of the month.
oh and i nominated my mum for mother of the year. i have yet to hear from them&nbsp;but they called mum on wednesday. she got through to the final bloody 3. that's 3, as in three. in the barnados australian mother of the bloody year awards. i have to go to this thing in town on april 3 and if she gets to the final 2, to sydney. much bloody hell.&nbsp;
joseph plays at the logan entertainment centre on april 5. same day charlotte's web opens. yes, i am being forced to miss the opening performance of the show im stage managing. this does not make me happy.&nbsp;
mum and two of my sisters saw joseph tonight. loved it.&nbsp;
friend from work and her kids are coming tomorrow.
in short i feel rather overwhelmed right now. too overwhelmed to be properly excited. 
my head hurts. love yez all

uq sent me a letter today. they want&nbsp;me to finish my ba and then do honours hprc. they can go to hell. i dont want to&nbsp;go back to uni. i may or may not change my mind about that but at the moment it's a no go.&nbsp;
called my grandma today cos it was her birthday yesterday. seriously am i the only one&nbsp;with a grandparent who wears hot pink and is still all girly in their late 60s?&nbsp;damn. apparently my calling her made her day. it always does. apparently.
which is why im&nbsp;not too concerned about coming out to her and my grandfather (they're dad's parents). they, and my mum's parents come to that, are all of the more conservative era. i have no idea&nbsp;how they would react if i were to tell them that this girl i live with, im actually dating her. um. for the last year. yes, im gay. no, i dont want&nbsp;a boyfriend.&nbsp;
something tells me they wouldnt react all that positively. but they love me too much to want to estrange me. so they would have to come to terms with it like my parents did, cos im not changing for them.&nbsp;
monday is the big day. probably going down to the gold coast instead of redcliffe now. cant really afford a canoe.&nbsp;
ok im going to go now.
love yez all

&nbsp;no more music school!! on the negative side i knew one of my students would be away today, that was no big deal, but the fact that my first student didnt turn up without any notice and another one only let me know a couple of hours before her lesson was scheduled did NOT make me happy. so. i earned a whole $18 today- that's an hour's work.
dude. never go to a music school. beyond getting your 2-year-old involved in some sort of early childhood music class, never ever go to a music school. always go to a private teacher. dude. i cannot emphasise that enough.&nbsp;
not so sure what's happening next year. bit worried about that.&nbsp;
im tired. love yez all

semantics 6- considering i&nbsp;was&nbsp;expecting maybe a 4. wow.
lang and soc id- 7- i was expecting a 6, possibly even a 5
nt greek- 7. ok, i expected that.&nbsp;
but i seriously thought my gpa would&nbsp;suffer this semester. instead it has gone up- 6.33 up to 6.667.&nbsp;i dont&nbsp;know what to think&nbsp;

ok bad reference. anyway to explain that i got a call from the director of joseph today and im IN and im in the female chorus. i never expected to get the narrator, which is what i went for, but im in the chorus and im happy.&nbsp;so in feb/march or summing i shall be on stage for the first time since.. may.. 06. way too long. so if beenleigh isnt too far for you to reasonably travel, you're coming to see a show. because i said.&nbsp;
oh and peg and i were 11 months on saturday. i dont know if i said.&nbsp;but yeah im happy about that too.
what im not so happy about is my throat and my ears. for some reason the ears are worse now that ive just had a shower. not happy.

&nbsp;it was 11 months on saturday. it was also a good performance. the goose's name was susan.&nbsp;
woke up at about 10 to 12 today.&nbsp;
yesterday was crazy. more later when i feel awake.
i need to get dressed so i can go with peg to her parents' house and pick up a lawnmower so she can do the yard. claire, you interested in weeding for us at all? i want to do it at some point, and i would help,&nbsp;but you wouldnt believe how much of it there is and peg doesnt seem to think its her job as the tenant of the house to make sure the garden is weeded. ive told her grass seeds arent expensive and its way to easy to get snakes in high, fast-growing weeds and for the sake of her dog she needs to look after the garden but anyway.&nbsp;
love yez all

&nbsp;i have been attacking my ling2000 essay once again. i think its actually workable but im not about to touch the stuff ive already written unless there's a fundamental problem with it. right now i just want to pass. i can deal with not getting on the dean's list.&nbsp;
i am now up to 2243 words, estimated count without references and my one actual quote (as i am including examples) 2100. out of 2500-3000. that's a very open sort of range.&nbsp;
also need abuot 1000 more words on 2035 essay. will do that this afternoon. they're both due tomorrow along with the greek exam that rick let us take home. i did some of it last night, it's almost finished now. most of a parsing question (something like 'identify and parse all the participial forms and infinitives in this passage. ive done 3. there are lots more to go. it is after all a 4 or so line passage), some multiple choice then it's done. the unseen translation was the killer (word in the dative, didnt say why. i ended up making it a possessive. the number 3 for some reason. ended up making it part of the prepositional phrase preceeding it. the rest was easy, except for 2 words that took me ages to find). after tomorrow i shall be free. except that i have work. and a show. and an audition the day after said show opens. i will not be telling sally. she can find out on her own. and noone tell her, k??
